import React, { Component } from 'react';
import { Link, withRouter } from "react-router-dom";
import './navbar.css'

class NavBar extends Component {
  render() {
    return (
      <nav className='navbar'>
        <Link to="/" className={window.location.pathname === "/" ? "navbarTabsLink" : "active"}>
          Fortune Realty
        </Link>

        <Link to="/about-us" className={window.location.pathname === "/about-us" ? "navbarTabsLink" : "active"}>
          About Us
        </Link>

        <Link to="/buy" className={window.location.pathname === "/buy" ? "navbarTabsLink" : "active"}>
          Buy
        </Link>

        <Link to="/sell" className={window.location.pathname === "/sell" ? "navbarTabsLink" : "active"}>
          Sell
        </Link>

        <Link to="/testimonials" className={window.location.pathname === "/testimonials" ? "navbarTabsLink" : "active"}>
          Testimonials
        </Link>

        <Link to="/contact" className={window.location.pathname === "/contact" ? "navbarTabsLink" : "active"}>
          Contact
        </Link>
      </nav>
    )
  }
}

export default withRouter(NavBar);
